import React from 'react';

const ImageChangeOnMouseOver = () => {
    return (  
        <div>
            <img src={require('../static/bw/speaker1.jpg')} alt="" />
            &nbsp;&nbsp;&nbsp;
            <img src={require("./static/bw/speaker2.jpg")} alt="" />
        </div>
    );
}

export default ImageChangeOnMouseOver;
